import Header from './comp/Header'
import MovieList from './comp/MovieList'
import Movie from './comp/Movie'
import './style-main.css'
import './style-global.css'
import './style-animation.css'

import { useState } from 'react'

function App() {

  return (
    <>
    <Header />
    <div className="main">
      <Movie>
        <MovieList />
      </Movie>
    </div>
    </>
  );
}

export default App;
